import React, { useState } from 'react';
import './LoginSignup.css';

const LoginSignup = () => {
    const [state, setState] = useState('Login');
    const [formData, setFormData] = useState({
        username: "",
        password: "",
        email: "",
    })

    const login = async () => {
        console.log("Login Function Executed!");
    }

    const signup = async () => {
        console.log("Signup Function Executed!");
    }

    return (
        <div className='login-signup'>
            <div className='login-signup-container'>
                <h1>{state}</h1>
                <div className='login-signup-fields'>
                    {state==="Sign Up"?<input type='text' placeholder='Name' />:<></>}
                    <input type='email' placeholder='Email Adress' />
                    <input type='password' placeholder='Password' />
                </div>
                <button onClick={() => {
                    state==="Login"?login():signup()
                }}>Continue</button>
                {state==="Sign Up"
                ?<p className='login'>Already have an account? <span onClick={() => {setState("Login")}}>Login here</span></p>
                :<p className='login'>Create an account? <span onClick={() => {setState("Sign Up")}}>Click here</span></p>}
                <div className='agree'>
                    <input type='checkbox' name='' id='' />
                    <p>By continuing, I agree to the terms of use & privacy policy.</p>
                </div>
            </div>
        </div>
    )
}

export default LoginSignup
